// Home btn
import styled from 'styled-components';

const Power = styled.button`
  position: fixed;
  top: 2rem;
  left: 50%;
  transform: translateX(-50%);
  background: #FCF6F4;
  padding: .3rem;
  border-radius: 50%;
`

const PowerButton = () => {
    return (
        <Power>
            Home
        </Power>
    )
}

export default PowerButton;
